document.getElementById('pdf-form').addEventListener('submit', async (e) => {
    e.preventDefault();
    
    const fileInput = document.getElementById('pdf-upload');
    const file = fileInput.files[0];
    
    if (file && file.type === 'application/pdf') {
        const arrayBuffer = await file.arrayBuffer();
        const pdfDoc = await PDFLib.PDFDocument.load(arrayBuffer);

        // Base64 string of your logo and watermark images
        const logoBase64 = 'data:image/png;base64,'; // Replace with actual base64 string
        
        
        const watermarkBase64 = 'data:image/png;base64,'; // Replace with actual base64 string
        
        // Convert Base64 to Uint8Array
        const logoBytes = Uint8Array.from(atob(logoBase64.split(',')[1]), c => c.charCodeAt(0));
        const watermarkBytes = Uint8Array.from(atob(watermarkBase64.split(',')[1]), c => c.charCodeAt(0));

        const logoImage = await pdfDoc.embedPng(logoBytes);
        const watermarkImage = await pdfDoc.embedPng(watermarkBytes);
        const pages = pdfDoc.getPages();

        // Company details
        const headerText = '';
        const footerText = ' \n                   CH. MAZHAR IQBAL SEEDS TRADING COMPANY  PRIVATE LIMITED  ';
        

        const removeExistingHeaderFooter = (page, headerHeight, footerHeight) => {
            const { height, width } = page.getSize();
            page.drawRectangle({
                x: 0,
                y: height - headerHeight,
                width: width,
                height: headerHeight,
                color: PDFLib.rgb(1, 1, 1),
                opacity: 1,
            });
            page.drawRectangle({
                x: 0,
                y: 0,
                width: width,
                height: footerHeight,
                color: PDFLib.rgb(1, 1, 1),
                opacity: 1,
            });
        };

        const addHeaderFooter = (page, logoImage, headerText, footerText) => {
            const { height, width } = page.getSize();
            const logoDims = logoImage.scale(0.31);  // Adjust the scale factor for the logo image

            // Header logo image (left side)
            page.drawImage(logoImage, {
                x: 10,
                y: height - logoDims.height - 10, // Adjust position accordingly
                width: logoDims.width,
                height: logoDims.height,
            });

            // Footer text
            page.drawText(footerText, {
                x: 45, // Adjust x position for footer text
                y: 45, // Adjust y position for footer text
                size: 12,
                color: PDFLib.rgb(0, 0, 0),
                lineHeight: 10,
            });

            // Header text
            page.drawText(headerText, {
                x: logoDims.width + 20,
                y: height - logoDims.height - 10, // Adjust y position for header text
                size: 12,
                color: PDFLib.rgb(0, 0, 0),
                lineHeight: 14,
            });
        };

        const addWatermark = (page, watermarkImage) => {
            const { height, width } = page.getSize();
            const watermarkDims = watermarkImage.scale(0.5);  // Adjust the scale factor for the watermark image

            page.drawImage(watermarkImage, {
                x: (width - watermarkDims.width) / 2,
                y: (height - watermarkDims.height) / 2,
                width: watermarkDims.width,
                height: watermarkDims.height,
                opacity: 0.32 // Set transparency
            });
        };

        pages.forEach(page => {
            removeExistingHeaderFooter(page, 70, 70); // Adjust height if necessary
            addHeaderFooter(page, logoImage, headerText, footerText);
            addWatermark(page, watermarkImage);
        });

        const pdfBytes = await pdfDoc.save();
        
        // Create a blob and a link to download the modified PDF
        const blob = new Blob([pdfBytes], { type: 'application/pdf' });
        const link = document.createElement('a');
        link.href = URL.createObjectURL(blob);
        link.download = file.name.replace('.pdf', '_ledger.pdf');
        link.textContent = 'Download modified PDF';
        
        const outputDiv = document.getElementById('output');
        outputDiv.innerHTML = ''; // Clear previous output
        outputDiv.appendChild(link);
    } else {
        alert('Please upload a valid PDF file.');
    }
});
